import './App.css';
import Header from './Header';
import Footer from './Footer';
import BottomPanel from './BottomPanel';
import LeftPanel from './LeftPanel';
import RightPanel from './RightPanel';

function App() {
  return (
    <body>
      <Header />
      <LeftPanel />
      <RightPanel />
      <BottomPanel />
      <Footer />
    </body>
  );
}

export default App;
